import './Card.css'
import {projects} from './Project';

function Card(){
    projects.map(project=>{
    return(
        <div className='card-item'>
            <div className='card-text'>
                <div className='card-title'>{project.title}</div>
                <div>{project.description}</div>
            </div>
            <img src={project.image}></img>
        </div>
    )

    })
}
export default Card;
